Canada / Bulgarije
Actie / Avontuur
86 minuten

geregisseerd door Uwe Boll
met Dominic Purcell, Ralitsa Paskaleva en Bashar Rahal

Hazen Kaine, een Amerikaanse huurmoordenaar die in Sofia in Bulgarije woont, krijgt meer op zijn dak dan hij gehoopt had als hij een contract sluit met de maffia. Het is de laatste klus voor dat hij er uit stapt en aan een nieuw leven begint. Het doel: de drie kinderen van de koninklijke miljardair Andon Dupont. Het lijkt een simpele missie, maar een simpele halsketting van een van de kinderen zorgt er voor dat hij in de middeleeuwen terecht komt.



